import './User.css'
function User(){
    let login = window.location.search === '?register';
    return(
        <div className='content_block'>
            <div className='user_header'>
                <div id='register_label'><label  className='user_active_header'>Register</label></div>
                <div className='Login_label'>Login</div>
            </div>
        </div>
    );
}

export default User;
